using ArcadeMachine.Domain.Entities;
using ArcadeMachine.Infraestructure.Persistence;

namespace ArcadeMachine.Infraestructure.Seeds;

public static class MiniJuegoSeeder
{
    public static void SeedData(IServiceProvider serviceProvider)
    {
        using (var scope = serviceProvider.CreateScope())
        {
            var dbContext = scope.ServiceProvider.GetRequiredService<AplicationDbContext>();

            // Verificar si ya existen datos
            if (dbContext.Minijuegos.Any())
            {
                return;
            }

            var miniJuego = new List<MiniJuego>()
            {
                new()
                {
                    Id = Guid.NewGuid(),
                    Img =
                        @"",
                    Nombre = "Piedra, Papel y Tijeras",
                    Color = "#9b57f0",
                    ShadowColor = "#dcc1fd",
                    Slug = "piedra-papel-tijeras",
                },
                new()
                {
                    Id = Guid.NewGuid(),
                    Img =
                        @"",
                    Nombre = "Ahorcado",
                    Color = "#ffb900",
                    ShadowColor = "#ffe49e",
                    Slug = "ahorcado",
                },
                new()
                {
                    Id = Guid.NewGuid(),
                    Img =
                        "",
                    Nombre = "XO",
                    Color = "#dd2bbc",
                    ShadowColor = "#fba4ea",
                    Slug = "xo",
                }
            };
            dbContext.Minijuegos.AddRange(miniJuego);
            dbContext.SaveChanges();
        }
    }
}